import { Calendar } from "grommet";
import React from "react";
const propTypes = {};

const defaultProps = {};

export default function calendar(props) {
  return (
    <section>
      <Calendar />
      <form action="">
        <input type="date" />
      </form>
    </section>
  );
}

calendar.propTypes = propTypes;
calendar.defaultProps = defaultProps;
